/**
 * @fileoverview Date/Time patterns data type.
 */
/**
 * The type definition for date/time patterns.
 * @interface
 */
export class DateTimePatternsType {
    /** @type {string} */
    YEAR_FULL: string;
    /** @type {string} */
    YEAR_FULL_WITH_ERA: string;
    /** @type {string} */
    YEAR_MONTH_ABBR: string;
    /** @type {string} */
    YEAR_MONTH_FULL: string;
    /** @type {string} */
    YEAR_MONTH_SHORT: string;
    /** @type {string} */
    MONTH_DAY_ABBR: string;
    /** @type {string} */
    MONTH_DAY_FULL: string;
    /** @type {string} */
    MONTH_DAY_SHORT: string;
    /** @type {string} */
    MONTH_DAY_MEDIUM: string;
    /** @type {string} */
    MONTH_DAY_YEAR_MEDIUM: string;
    /** @type {string} */
    WEEKDAY_MONTH_DAY_MEDIUM: string;
    /** @type {string} */
    WEEKDAY_MONTH_DAY_YEAR_MEDIUM: string;
    /** @type {string} */
    DAY_ABBR: string;
    /** @type {string} */
    MONTH_DAY_TIME_ZONE_SHORT: string;
}
